import React from "react";

function LookupResultField(props) {



    return (
        <div className="lookup-result-box">
            <div className="lookup-result-field view">
                <button
                    className="view-button"
                    // onClick={}
                    >View
                </button>
            </div>
            <p className="lookup-result-field">{props.name}</p>
            <p className="lookup-result-field">{props.license}</p>
            <p className="lookup-result-field">{props.vehicle}</p>
            <p className="lookup-result-field">{props.plan}</p>
        </div>
    )
}

export default LookupResultField;
